body,html{
    position: absolute;
    margin: 0;
    padding: 0;
    top: 0;
    right: 0;
    left: 0;
    bottom: 0;
    overflow: hidden;
    background: 0 0;

    touch-action: none;
}

canvas {
    position: fixed;
    top: 0;
    left: 0;
}

#ui {
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    z-index: 99;
}


.screen {
    width: 100%;
    height: 100%;
    position: absolute;
    top: 0;
    left: 0;
}

.cover {
    background: rgba(0, 0, 0, 0.5);
}

.center-absolute {
    position: absolute;
    left: 0;
    right: 0;
    bottom: 0;
    top: 0;
    margin: auto;
}


.not-select{
    -moz-user-select: none;
    -webkit-user-select: none;
    user-select: none;
}

.hide {
    visibility: hidden;
    opacity: 0;
    transition: opacity 1s, visiblility 1s;
}

.show {
    visibility: visible;
    opacity: 1;
    transition: opacity 1s, visiblility 1s;
}

.simple-pulse{
    animation-name: pulse;
    animation-duration: 0.5s;
    animation-iteration-count: infinite;
    animation-direction: alternate;
}

#animation_container {
    position:absolute;
    margin:auto;
    left:0;right:0;
    top:0;bottom:0;
}


@keyframes alpha {
    0% {
        opacity: 1;
    }

    100% {
        opacity: 0;
    }
}

.rail-hand{
    position: absolute;
    width:120px;
    height:120px;

    animation-name: pulse;
    animation-duration: 0.5s;
    animation-iteration-count: infinite;
    animation-direction: alternate;
}

.rail-hand img{
    transform: rotate(-10deg);
    max-width: 100%;
    max-height: 100%;
}

.low-fuel{
    position: absolute;
    transform-origin: top left;

    animation-name: alpha;
    animation-duration: 0.5s;
    animation-iteration-count: infinite;
    animation-direction: alternate;
}


.info-text{
    position: absolute;
    text-align: center;
    font-size: 40px;
    font-family: ui-font;
    width:100%;

    color: #d1445e;

    animation-name: pulse;
    animation-duration: 0.15s;
    animation-iteration-count: infinite;
    animation-direction: alternate;

}

.circle-bar{
    position: absolute;
    left: 100px;
    top: 100px;
    background: #ffffff;
    width: 150px;
    height: 150px;
    z-index: 990;
}

.rail-hand, .text-box{

}
@keyframes alpha2 {
    0% {
        opacity: 1;
    }

    100% {
        opacity: 0;
    }
}


#custom-preloader-pf{
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background: #333;
    z-index: 99999;

    display: flex;
    align-items: center;
    flex-direction: column;

    justify-content: center;
    justify-content: space-evenly;

}
/*TOP PART*/

    width: 50%;
    max-height: 40%;

}

    max-height: 100%;
}

/*BOTTOM PART*/

    max-width: 40%;

}

.custom-preloader-item-bottom>*{

}

    display: block;
    width: 100%;
    height: 100%;
    opacity: 0.08;
    top:0;
    left:0;

    animation-name: bg-drag;
    animation-duration: 80s;
    animation-iteration-count: infinite;
    animation-timing-function: linear;
    /* animation-direction: alternate; */

    background-size: 1;
}
#preloader-inner {
    position: absolute;
    width: 100%;
    height: 100%;
}

#preloader-center {
    position: absolute;
    top: 0;
    right: 0;
    bottom: 0;
    left: 0;
    margin: auto;

    max-width: 45%;
    max-height: 35%;
    aspect-ratio: 1/1;
}

#play {
    position: absolute;
    left: 0;
    top: 15px;

    animation-name: play-pulse;
    animation-duration: 0.7s;
    animation-iteration-count: infinite;
    animation-timing-function: ease-in-out;
}

#gear {
    position: absolute;
    left: 45px;

    animation-name: gear-turn;
    animation-duration: 2.66s;
    animation-iteration-count: infinite;
    animation-timing-function: linear;
}

#hand-container {
    border-radius: 50%;
    background: #ffffff;
    width: 100%;
    height: 100%;
    display: flex;
    justify-content: center;
    align-items: center;
    align-content: center;

    position: relative;
    z-index: 1;
    overflow: hidden;

}

#hand {
    width: 75%;
    height: 75%;
    display: flex;
    align-content: center;
    justify-content: center;
    transform: rotate(-25deg);
    align-items: center;
}

#white-circle {
    position: absolute;
    border-radius: 50%;

    width: 100%;
    height: 100%;
    background: #fff;

    animation-name: circle-pulse;
    animation-duration: 0.7s;
    animation-iteration-count: infinite;
    animation-timing-function: ease-in-out;
}
.loading-circle {
    position: absolute;
    border-radius: 50%;

    width: 100%;
    height: 100%;
    /* background: #000; */

    transform: scale(1.1);
    overflow: hidden;

    visibility: visible;
    transform: scale(1.1);
    /* animation-name: circle-pulse;
    animation-duration: 0.7s;
    animation-iteration-count: infinite;
    animation-timing-function: ease-in-out; */
}
.loading-circle-inner {
    width: 100%;
    height: 100%;
    /* background: #00b506; */

    transform: rotate(90deg);
    background-color: #000000;

    /* background-image:
        linear-gradient(300deg, transparent 50%, white 50%),
        linear-gradient(0deg, white 50%, transparent 50%); */

    /* background-image:
        linear-gradient(20deg, transparent 50%, #00b506 50%),
        linear-gradient(0deg, white 50%, transparent 50%); */
}

#hand-image {
    max-width: 100%;
    max-height: 100%;

    animation-name: play-pulse;
    animation-duration: 0.7s;
    animation-iteration-count: infinite;
    animation-timing-function: ease-in-out;

    transform: scale(1);
}

#pf-title {
    max-width: 40%;
    max-height: 10%;
    position: absolute;
    bottom: 1vh;
    right: 0;
    left: 0;
    margin: auto;
}

#pf-gear {
    max-height: 6%;
    position: absolute;
    bottom: 1vh;
    right: 1vh;
}
#pf-text {
    max-height: 6%;
    position: absolute;
    bottom: 1vh;
    left: 1vh;
}
#pf-badge { display: none !important;
    max-height: 6%;
    position: absolute;
    bottom: 2vh;
    left: 0;
    right: 0;
    margin: auto;
}

@media screen and (orientation: landscape) {
    #pf-gear {
        max-height: 9%;
    }
    #pf-text {
        max-height: 9%;
    }
    #pf-badge {
        max-height: 9%;
    }
}

#tap-text {

.resize-box {
    box-sizing: border-box;
    pointer-events: none;
}

.resize-box.hide .handler {
    opacity: 0;
}

.resize-box.passive *:not(.translate-rect) {
    display: none;
}

.translate-rect {
    position: absolute;
    top: -1px;
    bottom: -1px;
    left: -1px;
    right: -1px;

    box-sizing: border-box;
    pointer-events: auto;
}

.dumb-rect {
    position: absolute;
    top: -1px;
    bottom: -1px;
    left: -1px;
    right: -1px;

    box-sizing: border-box;
    border: 2px solid #00d9e1;
    pointer-events: none;
}

.handler {
    pointer-events: auto;
}

.drag-box {
    /* cursor: pointer; */
    transition: all 0.5s;

    display: flex;
    align-items: center;
    justify-content: center;

    opacity: 1;
}

.drag-box-side::after {
    content: "";
    width: 4px;
    height: 16px;
    box-shadow: 0 0 5px 1px rgb(57 76 96 / 15%), 0 0 0 1px rgb(53 71 90 / 20%);
    border-radius: 6px;
    background: #fff;
    position: relative;
    display: block;
    transition: background 0.5s;
}

.drag-box-y::after {
    width: 16px;
    height: 4px;
}

.corner-drag-box {
    --outward-x: 16px;
}


.resize-box-text .tm::after {
    display: none;
}

.resize-box-text .bm::after {
    display: none;
}

.drag-box:hover:after {
    background: #00d9e1;
}

.corner-drag-box:hover span {
    background: #00d9e1;
}

.corner-drag-box > span {
    /* content: ""; */
    display: block;
    box-shadow: 0 0 5px 1px rgb(57 76 96 / 15%), 0 0 0 1px rgb(53 71 90 / 20%);

    width: 12px;
    height: 12px;
    border-radius: 6px;
    background: #fff;
    position: absolute;
}

.rotate-box {
    box-shadow: 0 0 5px 1px rgb(57 76 96 / 15%), 0 0 0 1px rgb(53 71 90 / 20%);

    width: 30px;
    height: 30px;
    border-radius: 15px;
    background: #fff;
    position: absolute;
    top: 100%;
    left: 0;
    right: 0;
    margin: auto;

    transform: translateX(-20px) translateY(15px);
    display: flex;

    justify-content: center;
    align-items: center;
}

.rotate-box::after {
    content: "‚ü≤";
    display: block;
    font-size: 20px;
}

.delete-box-wrapper {
    box-shadow: 0 0 5px 1px rgb(57 76 96 / 15%), 0 0 0 1px rgb(53 71 90 / 20%);

    width: 30px;
    height: 30px;
    border-radius: 15px;
    background: #fff;
    position: absolute;
    top: 100%;
    right: 16px;
    margin: auto;

    transform: translateX(20px) translateY(15px);
    transform-origin: center;
    display: flex;

    justify-content: center;
    align-items: center;
}

.delete-box-wrapper::after {
    display: block;
    font-size: 20px;
}

    function applyStylePF(id, property, value) {
        if (!items[id]) {
            items[id] = document.getElementById(id);
        }
        let item = items[id];
        if (item) {
            item.style[property] = value;
        }
    }

    var progress = 0;

    function updateProgressPF() {
        if(!document.getElementById("preloader-pf")){
            clearTimeout(preloadIntervalPF);
            return;
        }
        if(!window.app || !window.app.data || !window.app.data.preloader) return;
        var params = window.app.data.preloader;

        var isEnabled = params.preloaderEnableBar;
        applyStylePF("loading-circle", "display", isEnabled ? "block" : "none");

        if (!isEnabled) return;

        var fillColor = params.preloaderBarFillColor || "#008be8";
        var bgColor = params.preloaderBarBgColor || "#000000";

        applyStylePF("loading-circle-inner", "backgroundColor", fillColor);
        progress += 0.4;
        if(progress > 100){
            progress = 100;

        }
        var value = progress * 3.6;

        if (progress > 50) {
            value = value - 180;

            applyStylePF(
                "loading-circle-inner",
                "backgroundImage",
                `linear-gradient(${value}deg, transparent 50%, ${fillColor} 50%), linear-gradient(0deg, ${bgColor} 50%, transparent 50%)`,
            );
        } else {
            applyStylePF(
                "loading-circle-inner",

            );
        }

    }
